def find_largest_square(M, R, C, K, Q, q_i, q_j):
    for i in range(1, R):
        M[i][0] -= M[i - 1][0]
    for i in range(1, C):
        M[0][i] += M[0][i - 1]
    for i in range(1, R):
        for j in range(1, C):
            M[i][j] = M[i - 1][j] + M[i][j - 1] - M[i - 1][j - 1] + M[i][j]
    res = [0] * Q
    for k in range(Q):
        i = q_i[k]
        j = q_j[k]
        p = 0
        while p + i < R and p + j < C and (i - p >= 0) and (j - p >= 0):
            (a, b, c) = (0, 0, 0)
            if j - p - 1 >= 0:
                a = M[i + p][j - p - 1]
            if i - p - 1 >= 0:
                b = M[i - p - 1][j + p]
            if j - p - 1 >= 0 and i - p - 1 >= 0:
                c = M[i - p - 1][j - p - 1]
            ans = M[i + p][j + p] - a - b + c
            if ans > K:
                break
            else:
                res[k] = 2 * p + 1
            p += 1
    return res

